import React from 'react'

import {NavbarContainer, NavbarWrapper} from "./NavBarElements";


const Navbar1 = () => {    
      return(
        <div>
            <NavbarContainer>
                <NavbarWrapper>
                    <h1>hola</h1>
                </NavbarWrapper>                
            </NavbarContainer>
            
        </div>
      );    
  };
  
  export default Navbar1;
